import React from 'react'
import './Home.css';
import logo from './imgs/Home.JPG';

function Home() {
  return (
    <div className="home">
     <div className=".home__bg">
         <div className="header d__flex align__items__center pxy__30">
         <div className="logo">
             <img src={logo} alt=""/>
             <div className="navigation">
                 <ul className="navbar">
                     <a href="#Home"><li className="nav__items px__15">Home</li></a>
                     <a href="#Home"><li className="nav__items px__15">Home</li></a> <a href="#Home"><li className="nav__items px__15">Home</li></a>

                 </ul>

             </div>
          </div>
        </div>
     </div>
    </div>
  )
}

export default Home;
